import React from "react";
import './Home.css'
const Home = () => {
  return (
    <div>
      <h1>Welcome to 4th grade 2nd Quarter</h1>
      <p>My name is Krystal Petrosky. This is my 7th year of teaching. I have a master degree in Reading intervention. I am also working on a 2nd master to make websites. I have been married to my husband for 20 years and have been together 23 years. We have two kids, two teenagers. Liam is 18 and working to buy his first car. Alec lives in Florida with their Godmother. We have 4 dogs. I am very excited to be here with you. </p>
    </div>
  );
};

export default Home;
